INSERT INTO `promotion_event` VALUES ('2024-05-23','2024-05-16',50000.00,'2024-05-03 23:58:56.978000','PE5','TƯNG BỪNG KHAI TRƯƠNG RẠP CHIẾU PHIM BHD STAR THE GARDEN: RỘN RÀNG CÙNG CHUỖI ƯU ĐÃI SIÊU KHỦNG\r\n\r\nCụm rạp thứ 10 của BHD Star Cineplex sẽ chính thức khai trương vào ngày 21/12/2019 tại Hà Nội với ưu đãi xem phim miễn phí cùng hàng ngàn chương trình khuyến mãi siêu khủng!\r\n\r\nTọa lạc tại tầng 4 TTTM The Garden Shopping Center thuộc khu đô thị The Manor, một trong những khu vực sầm uất và tấp nập, BHD Star The Garden sẽ là cụm rạp thứ 3 của hệ thống rạp chiếu phim BHD Star tại Hà Nội. Với cơ sở vật chất hiện đại, trang thiết bị phòng chiếu tối tân, cụm rạp hứa hẹn sẽ là địa điểm vui chơi, giải trí được yêu thích của người dân Thủ đô, đặc biệt là trong giai đoạn Giáng Sinh 2019 và Tết Canh Tý 2020. ???\r\n\r\nĐến rạp BHD Star The Garden, khách hàng sẽ được thưởng thức những siêu phẩm điện ảnh quốc tế mới nhất từ Hollywood. Với 6 phòng chiếu cùng hệ thống Digital đạt chuẩn quốc tế, công nghệ âm thanh Dolby 7.1 và các dịch vụ có 1-0-2 như ghế hạng First Class đi kèm các quyền lợi độc quyền: Welcome drink, lối vào ưu tiên, gối và chăn ấm, tủ đồ cá nhân và đặc biệt là được phục vụ tận ghế xem phim. Bên cạnh đó, đội ngũ phục vụ năng động và chuyên nghiệp sẽ mang đến cho khách hàng những trải nghiệm thoải mái tuyệt đối. Dù mang chất lượng tối ưu và hiện đại bậc nhất','45e7b8f1-614d-4962-acb6-a7bb34a9bdc3','slkmwczuh0y2tkha7sxw','http://res.cloudinary.com/dbxajsljz/image/upload/v1714755535/slkmwczuh0y2tkha7sxw.png','QUÉT MÃ QR – THẲNG TIẾN VÀO RẠP','QUYETMAQR','SAP_DIEN_RA'),('2024-05-21','2024-05-03',30000.00,'2024-05-03 23:40:16.323000','PE3','TƯNG BỪNG KHAI TRƯƠNG RẠP CHIẾU PHIM BHD STAR THE GARDEN: RỘN RÀNG CÙNG CHUỖI ƯU ĐÃI SIÊU KHỦNG\r\n\r\nCụm rạp thứ 10 của BHD Star Cineplex sẽ chính thức khai trương vào ngày 21/12/2019 tại Hà Nội với ưu đãi xem phim miễn phí cùng hàng ngàn chương trình khuyến mãi siêu khủng!\r\n\r\nTọa lạc tại tầng 4 TTTM The Garden Sh